\"856\",\"keywords\":[\"sailing vlog\",\"trimaran\",\"islands\",\"caribbean\",\"family\",\"lifestyle\",\"vlogs\",\"bikini\",\"familyvlogs\",\"dailyvlogs\",\"sailing around the world\",\"luxury\",\"travel\",\"sail\",\"relationships\",\"karaiby\",\"podróże\",\"blog rodzinny\",\"blog podróżniczy\",\"rejsy karaiby\",\"życie na karaibach\",\"sailing blog\",\"family blog\",\"życie poza systemem\",\"sailing\",\"beach life\",\"życie na łodzi\",\"życie na jachcie\",\"boat life\",\"wyspy karaibskie\",\"polacy za granicą\",\"blogi podróżnicze\",\"podróżniczka\",\"kanał podróżniczy\",\"sailboat\",\"bahamas\",\"catamaran\",\"liveaboard\"],\"channelId\":\"UCORUxNcRp8HMMgzm_zJ0YCw\",\"isOwnerViewing\":false,\"shortDescription\":\"Przed nami rodzinna wizytacja! A my zamiast prać dywany i szykować się na przyjazd rodzinki, przed nami jeszcze naprawa inwertera, lekcja kitesurfingu, lekcje angielskiego dla dzieci, no i żegluga 20 mil bo jesteśmy na Saint Lucia a rodzinka właśnie w samolocie na Martynikę! W 9 godzin można wiele!  A my nie możemy się doczekać bo lecą do nas .... słoiki z konfiturami od babci i kabanosy!\\n\\nAnia i Bartek\\n\\n ➡️ Subskrybujcie nasz kanał i prosimy pamiętajcie o włączeniu dzwoneczka 🔔 aby otrzymywać powiadomienia o najnowszych odcinkach 🙏\\n\\nPS. Niestety przez politykę Youtube w ramach \\\"ochrony dzieci\\\" mamy wyłączone komentarze pod odcinkami. Pracujemy nad tym, ale na razie to walka z wiatrakami. Wszystkie odcinki są na naszej stronie i tam można również je komentować.\\nhttps:\/\/www.sailoceans.com\\n\\nJesteśmy polską rodziną (Ania, Bartek, Kuba i Julian) podróżującą po świecie naszym pływającym domem, 15-metrowym trimaranem, jako sposób promowania alternatywnego stylu życia poza systemem. \\n\\nW 2014 roku udało nam się zmaterializować nasze marzenia i zamieszkać na stałe na pokładzie naszego najdroższego nowego domu - żaglówki „Poly”.\\n\\nDla nas żeglarstwo jest naszym sposobem na swobodne życie w zgodzie i harmonii z naturą i sobą nawzajem. To sposób na doświadczanie życia, ludzi i miejsc, całkowicie na naszych własnych warunkach. Przez wiele lat był to tylko sen, ale podążaliśmy za nim i to się spełniło. \\n\\nZapraszamy do naszego życia na łodzi, dzielimy się naszymi przygodami, wszystkimi szalonymi, przerażającymi i zabawnymi sytuacjami, ludźmi, miejsca, których doświadczamy na swojej drodze.\\n\\nWitamy w naszym życiu rodzinnym poza systemem.\\n\\nAnia, Bartek, Kuba i Julian\\nSailOceans\\n\\nJeżeli uważacie, że to co robimy, filmy które tworzymy mają sens, a chcecie zobaczyć jeszcze więcej, otrzymywać od nas drobne niespodzianki z miejsc, które odwiedzamy, a nawet wylosować pobyt u nas, dołączyć do grupy naszych Patronów.\\n\\nSami decydujecie o wysokości cegiełki, może to być nawet 1 dolar za miesiąc! Dla nas będzie to bardzo dużo! Rejestrujecie się RAZ, a potem już dostajecie powiadomienia od nas o EVENTACH, odcinkach, spotkaniach. \\n\\nSzczegóły: https:\/\/www.patreon.com\/SailOceans - Klikasz w \\\"Become a PATRON\\\" i potem wybierasz wariant, a jeżeli chcesz ustawić inny to przewiń stronę na dół i kliknij w \\\" Make a custom pledge\\\" i wpisz taka kwotę jaka Ci pasuje! A jeżeli potrzebujesz przy tym naszej pomocy to daj nam znać.\\nhttps:\/\/www.patreon.com\/SailOceans\\n\\nMożecie nas również wesprzeć na:\\nhttps:\/\/www.paypal.com\/donate\/?token=-M9AoCKtXHPRgvEJFfnAPLSpNtRUcK4m4entY9LV0qRtiO_e8HK-G-Gwfdgj4-Z7OqOxIG\\u0026country.x=US\\u0026locale.x=US\\n\\nObserwujcie nas również na innych platformach:\\nhttps:\/\/www.facebook.com\/sailoceans\/\\nhttps:\/\/www.instagram.com\/sailoceans\/\\n\\nDzięki!\\nZałoga \\\"POLY\\\"\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/t0JNcaHQoj8\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDCtVmEjEeQdtNPiBNh7L_i1pJsgg\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/t0JNcaHQoj8\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhC for now on it seems to be a mission impossible... 😞 You can comment all our episodes at our website:  https:\/\/www.sailoceans.com\/ \\n\\nWe are a Polish family (Ania, Bartek, Kuba and Julian) traveling the world and sailing across oceans on our floating home, a 15 meter trimaran, as a way of promoting alternative way of life off the grid. In 2014 we managed to materialize our dreams and traded a land based home in Poland for a permanent life on the ocean aboard our dearest new home - sailboat \\\"Poly\\\". \\n\\nFor us sailing is a way of free life in sync and harmony with nature and each other. It's a way of experiencing life, people, and places, entirely on our own terms. For many years it was just a dream, but we followed it and it came true. We are here and now, no longer chasing the dream. \\n\\nFollow us to see all the amazing, interesting, crazy, scary, and funny people, places and situations that we experience and learn from.\\n\\nWelcome to our family life unplugged.\\nAnia, Bartek, Kuba and Julian\\nSailOceans\\n\\nIf you enjoy our videos and think it's a good idea that we share our family life off the grid then please be so kind and support our effort. If you'd like to see a video on a particular subject please feel free to send us suggestions. Every one of your comments and every one of your dollars do count and make us feel that what we do is needed. Thank you so very much!\\n\\nhttps:\/\/www.paypal.com\/donate\/?token=...\\n\\nhttps:\/\/www.patreon.com\/SailOceans\\n\\nWhat is Patreon and how you can support us:\\nhttps:\/\/www.youtube.com\/watch?v=rwvUj...\\n\\nSubscribe at: \\nhttps:\/\/www.youtube.com\/caribcharter\\n\\nFollow us: \\nhttps:\/\/www.facebook.com\/sailoceans\/\\nhttps:\/\/www.instagram.com\/sailoceans\/\\n\\n\\nTHANK YOU!!!!!\\nPOLY Team\"},\"lengthSeconds\":\"856\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/caribcharter\",\"externalChannelId\":\"UCORUxNcRp8HMMgzm_zJ0YCw\",\"isFamilySafe\":true,\"availableCountries\":[\"AD impleText\":\"Adventures of Ania and Bartek with two little kids sailing across oceans on a 15 meter trimaran as a way of promoting alternative way of life off the grid. In 2014 we managed to materialize our dreams and traded a land based home in Poland for a permanent life on the ocean aboard our dearest new home - sailboat \\\"Poly\\\". \\n\\nFor us sailing is a way of free life in sync and harmony with nature and each other. It's a way of experiencing life, people, and places, entirely on our own terms. For many years it was just a dream, but we followed it and it came true. We are here and now, no longer chasing the dream. \\n\\nWe'd like to share it with you so that you can follow your dreams, too. Follow us to see all the amazing, interesting, crazy, scary, and funny people, places and situations that we experience and learn from.\\n\\nWelcome to our family life unplugged.\\n\\nAnia, Bartek, Kuba and Julian\\nSailOceans\\n\\nPlease support our life and travel: \\nhttps:\/\/www.patreon.com\/SailOceans\\n\\ne423f\"},\"callToAction\":{\"simpleText\":\"VISIT CHANNEL\"},\"dismiss\":{\"simpleText\":\"CANCEL\"},\"endpoint\":{\"clickTrackingParams\":\"CAQQ-N4BGAEiEwiwi8D44JjqAhU_KvEFHfTOBzYyDGl2LWVuZHNjcmVlbki_xMKOmq6TobcB\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"\/channel\/UCORUxNcRp8HMMgzm_zJ0YCw\",\"webPageType\":\"WEB_PAGE_TYPE_BROWSE\",\"rootVe\":3611}},\"browseEndpoint\":{\"browseId\":\"UCORUxNcRp8HMMgzm_zJ0YCw\"}},\"hovercardButton\":{\"subscribeButtonRenderer\":{\"buttonText\":{\"runs\":[{\"text\":\"SUBSCRIBE\"}]},\"subscribed\":false,\"enabled\":true,\"type\":\"FREE\",\"channelId\":\"UCORUxNcRp8HMMgzm_zJ0YCw\",\"showPreferences\":false,\"subscribedButtonText\":{\"runs\":[{\"text\":\"SUBSCRIBED\"}]},\"unsubscribedButtonText\":{\"runs\":[{\"text\":\"SUBSCRIBE\"}]},\"trackingParams\":\"CAUQmysiEwiwi8D44JjqAhU_KvEFHfTOBzYyDGl2LWVuZHNjcmVlbg==\",\"unsubscribeButtonText\":{\"runs\":[{\"text\":\"UNSUBSCRIBE\"}]},\"serviceEndpoints\":[{\"clickTracking e":"WEB_PAGE_TYPE_BROWSE","rootVe":3611}},"browseEndpoint":{"browseId":"UCORUxNcRp8HMMgzm_zJ0YCw","canonicalBaseUrl":"/user/caribcharter"}},"subscriberCountText":{"runs":[{"text":"31.3K subscribers"}]},"trackingParams":"CJkBEOE5IhMIro_A-OCY6gIVRGIWCh3C6A-3"}},"description":{"runs":[{"text":"Family visit! Instead of washing carpets and getting ready for the arrival of the family, we still have the inverter repair, kitesurfing lesson, English lessons for children, and then 20 miles sailing because we are in Saint Lucia and our family is on the way to Martinique. But! We can do a lot in 9 hours! And we can not wait because the grandmother's jam is coming to us!!!\n\nPlease remember to click ➡️subscribe button and turn on the notification bell🔔 to be notified about new episodes 👍🙏\n \nBTW. Because of YouTube policy the comments below the videos are disabled 😞 many channels with kids in the videos got the same issue... We are doing our best but for now on it seems to be a mission impossible... 😞 You can comment all our episodes at our website:  "},{"text":"https://www.sailoceans.com/","navigationEndpoint":{"clickTrackingParams":"CJYBEM2rARgBIhMIro_A-OCY6gIVRGIWCh3C6A-3SL_Ewo6arpOhtwE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=https%3A%2F%2Fwww.sailoceans.com%2F\u0026redir_token=lXueq7eWvpB9bYL0Fv1sp_pqQhJ8MTU5MzAyOTg5M0AxNTkyOTQzNDkz\u0026v=t0JNcaHQoj8\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=https%3A%2F%2Fwww.sailoceans.com%2F\u0026redir_token=lXueq7eWvpB9bYL0Fv1sp_pqQhJ8MTU5MzAyOTg5M0AxNTkyOTQzNDkz\u0026v=t0JNcaHQoj8\u0026event=video_description","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":" \n\nWe are a Polish family (Ania, Bartek, Kuba and Julian) traveling the world and sailing across oceans on our floating home, a 15 meter trimaran, as a way of promoting alternative way of life off the grid. In 2014 we managed to materialize our dreams and traded a land based home in Poland for a permanent life on the ocean aboard our dearest new home - sailboat \"Poly\". \n\nFor us sailing is a way of free life in sync and harmony with nature and each other. It's a way of experiencing life, people, and places, entirely on our own terms. For many years it was just a dream, but we followed it and it came true. We are here and now, no longer chasing the dream. \n\nFollow us to see all the amazing, interesting, crazy, scary, and funny people, places and situations that we experience and learn from.\n\nWelcome to our family life unplugged.\nAnia, Bartek, Kuba and Julian\nSailOceans\n\nIf you enjoy our videos and think it's a good idea that we share our family life off the grid then please be so kind and support our effort. If you'd like to see a video on a particular subject please feel free to send us suggestions. Every one of your comments and every one of your dollars do count and make us feel that what we do is needed. Thank you so very much!\n\n"},{"text":"https://www.paypal.com/donate/?token=","navigationEndpoint":{"clickTrackingParams":"CJYBEM2rARgBIhMIro_A-OCY6gIVRGIWCh3C6A-3SL_Ewo6arpOhtwE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=https%3A%2F%2Fwww.paypal.com%2Fdonate%2F%3Ftoken%3D\u0026redir_token=lXueq7eWvpB9bYL0Fv1sp_pqQhJ8MTU5MzAyOTg5M0AxNTkyOTQzNDkz\u0026v=t0JNcaHQoj8\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=https%3A%2F%2Fwww.paypal.com%2Fdonate%2F%3Ftoken%3D\u0026redir_token=lXueq7eWvpB9bYL0Fv1sp_pqQhJ8MTU5MzAyOTg5M0AxNTkyOTQzNDkz\u0026v=t0JNcaHQoj8\u0026event=video_description","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"...\n\n"},{"text":"https://www.patreon.com/SailOceans","navigationEndpoint":{"clickTrackingParams":"CJYBEM2rARgBIhMIro_A-OCY6gIVRGIWCh3C6A-3SL_Ewo6arpOhtwE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=https%3A%2F%2Fwww.patreon.com%2FSailOceans\u0026redir_token=lXueq7eWvpB9bYL0Fv1sp_pqQhJ8MTU5MzAyOTg5M0AxNTkyOTQzNDkz\u0026v=t0JNcaHQoj8\u0026event=video_desc eName":{"simpleText":"Tatar"}},{"languageCode":"te","languageName":{"simpleText":"Telugu"}},{"languageCode":"th","languageName":{"simpleText":"Thai"}},{"languageCode":"tr","languageName":{"simpleText":"Turkish"}},{"languageCode":"tk","languageName":{"simpleText":"Turkmen"}},{"languageCode":"uk","languageName":{"simpleText":"Ukrainian"}},{"languageCode":"ur","languageName":{"simpleText":"Urdu"}},{"languageCode":"ug","languageName":{"simpleText":"Uyghur"}},{"languageCode":"uz","languageName":{"simpleText":"Uzbek"}},{"languageCode":"vi","languageName":{"simpleText":"Vietnamese"}},{"languageCode":"cy","languageName":{"simpleText":"Welsh"}},{"languageCode":"fy","languageName":{"simpleText":"Western Frisian"}},{"languageCode":"xh","languageName":{"simpleText":"Xhosa"}},{"languageCode":"yi","languageName":{"simpleText":"Yiddish"}},{"languageCode":"yo","languageName":{"simpleText":"Yoruba"}},{"languageCode":"zu","languageName":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"t0JNcaHQoj8","title":"Życie na łódce: Słoiki z Polski nadciągają na Karaiby!","lengthSeconds":"856","keywords":["sailing vlog","trimaran","islands","caribbean","family","lifestyle","vlogs","bikini","familyvlogs","dailyvlogs","sailing around the world","luxury","travel","sail","relationships","karaiby","podróże","blog rodzinny","blog podróżniczy","rejsy karaiby","życie na karaibach","sailing blog","family blog","życie poza systemem","sailing","beach life","życie na łodzi","życie na jachcie","boat life","wyspy karaibskie","polacy za granicą","blogi podróżnicze","podróżniczka","kanał podróżniczy","sailboat","bahamas","catamaran","liveaboard"],"channelId":"UCORUxNcRp8HMMgzm_zJ0YCw","isOwnerViewing":false,"shortDescription":"Przed nami rodzinna wizytacja! A my zamiast prać dywany i szykować się na przyjazd rodzinki, przed nami jeszcze naprawa inwertera, lekcja kitesurfingu, lekcje angielskiego dla dzieci, no i żegluga 20 mil bo jesteśmy na Saint Lucia a rodzinka właśnie w samolocie na Martynikę! W 9 godzin można wiele!  A my nie możemy się doczekać bo lecą do nas .... słoiki z konfiturami od babci i kabanosy!\n\nAnia i Bartek\n\n ➡️ Subskrybujcie nasz kanał i prosimy pamiętajcie o włączeniu dzwoneczka 🔔 aby otrzymywać powiadomienia o najnowszych odcinkach 🙏\n\nPS. Niestety przez politykę Youtube w ramach \"ochrony dzieci\" mamy wyłączone komentarze pod odcinkami. Pracujemy nad tym, ale na razie to walka z wiatrakami. Wszystkie odcinki są na naszej stronie i tam można również je komentować.\nhttps://www.sailoceans.com\n\nJesteśmy polską rodziną (Ania, Bartek, Kuba i Julian) podróżującą po świecie naszym pływającym domem, 15-metrowym trimaranem, jako sposób promowania alternatywnego stylu życia poza systemem. \n\nW 2014 roku udało nam się zmaterializować nasze marzenia i zamieszkać na stałe na pokładzie naszego najdroższego nowego domu - żaglówki „Poly”.\n\nDla nas żeglarstwo jest naszym sposobem na swobodne życie w zgodzie i harmonii z naturą i sobą nawzajem. To sposób na doświadczanie życia, ludzi i miejsc, całkowicie na naszych własnych warunkach. Przez wiele lat był to tylko sen, ale podążaliśmy za nim i to się spełniło. \n\nZapraszamy do naszego życia na łodzi, dzielimy się naszymi przygodami, wszystkimi szalonymi, przerażającymi i zabawnymi sytuacjami, ludźmi, miejsca, których doświadczamy na swojej drodze.\n\nWitamy w naszym życiu rodzinnym poza systemem.\n\nAnia, Bartek, Kuba i Julian\nSailOceans\n\nJeżeli uważacie, że to co robimy, filmy które tworzymy mają sens, a chcecie zobaczyć jeszcze więcej, otrzymywać od nas drobne niespodzianki z miejsc, które odwiedzamy, a nawet wylosować pobyt u nas, dołączyć do grupy naszych Patronów.\n\nSami decydujecie o wysokości cegiełki, może to być nawet 1 dolar za miesiąc! Dla nas będzie to bardzo dużo! Rejestrujecie się RAZ, a potem już dostajecie powiadomienia od nas o EVENTACH, odcinkach, spotkaniach. \n\nSzczegóły: https://www.patreon.com/SailOceans - Klikasz w \"Become a PATRON\" i potem wy Qoj8?version=3\u0026autohide=1","width":1280,"height":720,"flashSecureUrl":"https://www.youtube.com/v/t0JNcaHQoj8?version=3\u0026autohide=1"},"title":{"simpleText":"Boat Life: Family Visit and We Are Not READY at All!"},"description":{"simpleText":"Family visit! Instead of washing carpets and getting ready for the arrival of the family, we still have the inverter repair, kitesurfing lesson, English lessons for children, and then 20 miles sailing because we are in Saint Lucia and our family is on the way to Martinique. But! We can do a lot in 9 hours! And we can not wait because the grandmother's jam is coming to us!!!\n\nPlease remember to click ➡️subscribe button and turn on the notification bell🔔 to be notified about new episodes 👍🙏\n \nBTW. Because of YouTube policy the comments below the videos are disabled 😞 many channels with kids in the videos got the same issue... We are doing our best but for now on it seems to be a mission impossible... 😞 You can comment all our episodes at our website:  https://www.sailoceans.com/ \n\nWe are a Polish family (Ania, Bartek, Kuba and Julian) traveling the world and sailing across oceans on our floating home, a 15 meter trimaran, as a way of promoting alternative way of life off the grid. In 2014 we managed to materialize our dreams and traded a land based home in Poland for a permanent life on the ocean aboard our dearest new home - sailboat \"Poly\". \n\nFor us sailing is a way of free life in sync and harmony with nature and each other. It's a way of experiencing life, people, and places, entirely on our own terms. For many years it was just a dream, but we followed it and it came true. We are here and now, no longer chasing the dream. \n\nFollow us to see all the amazing, interesting, crazy, scary, and funny people, places and situations that we experience and learn from.\n\nWelcome to our family life unplugged.\nAnia, Bartek, Kuba and Julian\nSailOceans\n\nIf you enjoy our videos and think it's a good idea that we share
